script: |
  super -f tsv -I q5898.sql | sort > q5898.out

vector: true

inputs:
  - name: q5898.sql
    data: |
      SELECT + MAX ( - col2 ) - - 25 AS col1 FROM tab1 AS cor0 WHERE NOT col1 + + col2 IN ( - col0 * + 94 / ( + col0 ), 22, + col0 + - col0 * - 23, - col2 );
  - name: tab1

outputs:
  - name: q5898.out
    data: |
      -34
